import React from "react";

class Shapka extends React.Component {
  render() {
    return (
      <header>{this.props.title}</header>
    );
  }
}

class App extends React.Component {
helpText = "Help >>text"
  render() {
    return (
      <div className="name">
        <Shapka title="SHAPKA PIE{IEIEP" name=""/>
        <Shapka title="shynar"/>
        <Shapka title="bek"/>

        <h1>{this.helpText}</h1>
        <input
          placeholder={this.helpText}
          onClick={this.inputClick}
          onMouseEnter={this.mouseEnter}
        />
        <p>{this.helpText === "Help >>text" ? "yes" : "no"}</p>
      </div>
    );
  }

  inputClick() {console.log('CLICKED')}
  mouseEnter() {console.log("Mouse")}
}
export default App
